import React from 'react';
import './App.css';

function Movie(props) {
  return (
      <div className="movie">
        <h1>{props.title}</h1>
        <p>Year: {props.year}</p>
        <img src={props.url} alt="Movie"/>
      </div>
  );
}

function App() {
  return (
    <div className="App">
      <Movie title="Wasabi" year="2001" url="data:image/jpeg;base64,"/>
      <Movie title="The Martian" year="2015" url="data:image/jpeg;base64,"/>
      <Movie title="Kingsman" year="2015" url="data:image/jpeg;base64,"/>
    </div>
  );
}


export default App;
